import React from 'react';

export const Post = (props) => {
    const posts = props.loadPosts.allPosts;
    const listItems = posts.map((postData) =>
        <li key={postData.id}>{postData.title}</li>
    );
    return (
        <ul>{listItems}</ul>
    );
}
